0026autohide=1\"},\"title\":{\"simpleText\":\"Mayerthorpe RCMP killings: Bad Day at Barhead (2008) - The Fifth Estate\"},\"description\":{\"simpleText\":\"Bad Day at Barhead examined whether the investigation into the Mayerthorpe police killings, including the arrests of two Alberta men, was aimed at distracting attention away from allegations of negligence within the force.  In 2008 The Fifth Estate explored what happened after the March 3, 2005, shooting deaths of RCMP officers Const. Anthony Gordon, Const. Lionide (Leo) Johnston, Const. Brock Myrol and Const. Peter Schiemann at a rural farm in Mayerthorpe, Alberta.  Shooter James Roszko died at the scene. Shawn Hennessey and Dennis Cheesman later pled guilty to four counts of manslaughter, related to providing assistance to Roszko on the day of the shooting.\\n\\n---\\nSubscribe for more videos from The Fifth Estate : http:\/\/bit.ly\/25W8cpn\\n\\nConnect with The Fifth Estate online : \\n\\nWebsite : http:\/\/bit.ly\/1d0FBxq\\nFacebook : http:\/\/bit.ly\/1UO9B8S\\nTwitter : http:\/\/bit.ly\/237VM8P\\nInstagram : http:\/\/bit.ly\/25W8SLs\\n\\nAbout the fifth estate : For four decades The Fifth Estate has been Canada's premier investigative documentary program. Hosts Bob McKeown, Habiba Nosheen, Gillian Findlay and Mark Kelley continue a tradition of provocative and fearless journalism. the fifth estate brings in-depth investigations that matter to Canadians – delivering a dazzling parade of political leaders, controversial characters and ordinary people whose lives were touched by triumph or tragedy.\"},\"lengthSeconds\":\"2473\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/channel\/UCa-bX3gZC3YnCThlGM5d38Q\",\"externalChannelId\":\"UCa-bX3gZC3YnCThlGM5d38Q\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\"
